import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, TextInput } from 'react-native';
import Svg, { Path, Defs, LinearGradient, Stop } from 'react-native-svg';

export default function App() {

  function Svg() {

    return (
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320" >
    <path
      fill="#09f"
      d="m0 256 9.2-37.3C18.5 181 37 107 55 80c18.8-27 37-5 56 10.7 18.2 16.3 37 26.3 55 42.6 18.6 15.7 37 37.7 56 32 18-5.3 36-37.3 55-26.6C295.4 149 314 203 332 240c18.8 37 37 59 56 21.3C406.2 224 425 128 443 96c18.5-32 37 0 55 37.3 18.9 37.7 37 79.7 56 90.7 18.3 11 37-11 55 0 18.7 11 37 53 56 58.7 18.1 5.3 37-26.7 55-69.4C738.5 171 757 117 775 80c18.8-37 37-59 56-58.7C849.2 21 868 43 886 96c18.6 53 37 139 56 170.7 18 32.3 36 10.3 55-26.7 18.4-37 37-91 55-106.7 18.8-16.3 37 5.7 56 5.4 18.2.3 37-21.7 55-48 18.5-26.7 37-58.7 55-53.4 18.9 5.7 37 47.7 56 64 18.3 15.7 37 5.7 55-5.3 18.7-11 37-21 56-26.7 18.1-5.3 37-5.3 46-5.3h9V0H0Z"
    />
  </svg>
    );
  }

  return (
    <View style={styles.container}>
      <Text style={styles.title} >Hello</Text>
      <Text style={styles.subTitle} >Sign In to your account</Text>
      <TextInput style={styles.TextInput} placeholder="Jhon@email.com" />
      <TextInput style={styles.TextInput} placeholder="Password" />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f1f1f1',
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 80,
    color: '#34434d',
    fontWeight: 'bold',
  },
  subTitle: {
    fontSize: 20,
    color: 'grey',
    fontWeight: 'bold',
  },
  TextInput: {
    color: 'grey',
    fontWeight: 'bold',
    backgroundColor: '#fff',
    paddingStart: 30,
    padding: 10,
    width: "80%",
    height: 50,
    margin: 10,
    borderRadius: 30,
  },
});
